import React, { useState } from 'react';
import TechnicalAnalyzeComp from './technicalAnalyzeComp';
import Tabs from "@mui/material/Tabs";
import Tab from '@mui/material/Tab';

function AnalysisComp() {
    const [filter, setFilter] = useState(["無", "無", "無"])
    const [type, setType] = useState("technicalAnalyze")


    const handleChange = (event, newValue) => {
        console.log(newValue)
        setType(newValue);
    };


    return (
        <>
            <div className = "card h-100 p-0">
                <div className = "card-header text-center">
                    目前篩選條件
                </div>

                <div className = "card-body">
                    <ul className = 'list-group list-group-flush'>
                        {filter.map((ele, i) => {return <li className = "list-group-item">{ele}</li>})}
                    </ul>
                </div>
            </div>

            <div className = 'row mx-auto' style = {{ width : "50vw" }}>
                <Tabs value = { type } onChange = { handleChange }>
                    <Tab label = "技術面"></Tab>
                </Tabs>
            </div>
        </>
    );
}

export default AnalysisComp;
